import React from 'react';

const Topbar = () => {
  return (
    <div className="frame-container" style={{ height: '48px', background: '#FFEDEA', display: 'flex', alignItems: 'center', justifyContent: 'center', boxSizing: 'border-box', padding: '10px 644px' }}>
      <span
        style={{
          color: '#1C264C',
          fontFamily: 'Sora, sans-serif',
          fontWeight: 400,
          fontSize: '16px',
          lineHeight: '48px',
          letterSpacing: '-0.05em',
          textTransform: 'capitalize',
          whiteSpace: 'nowrap',
          display: 'flex',
          alignItems: 'center',
        }}
      >
        {/* Fire SVG Icon */}
        <svg width="22" height="22" viewBox="0 0 24 24" fill="orange" xmlns="http://www.w3.org/2000/svg" style={{ marginRight: '6px' }}>
          <path d="M12 2C12 2 7 7.5 7 12C7 15.3137 9.68629 18 13 18C16.3137 18 19 15.3137 19 12C19 7.5 12 2 12 2ZM12 16C10.3431 16 9 14.6569 9 13C9 11.3431 10.3431 10 12 10C13.6569 10 15 11.3431 15 13C15 14.6569 13.6569 16 12 16Z"/>
        </svg>
        Goods to go near or far booktranspo is here!
        {/* Fire SVG Icon */}
        <svg width="22" height="22" viewBox="0 0 24 24" fill="orange" xmlns="http://www.w3.org/2000/svg" style={{ marginLeft: '6px' }}>
          <path d="M12 2C12 2 7 7.5 7 12C7 15.3137 9.68629 18 13 18C16.3137 18 19 15.3137 19 12C19 7.5 12 2 12 2ZM12 16C10.3431 16 9 14.6569 9 13C9 11.3431 10.3431 10 12 10C13.6569 10 15 11.3431 15 13C15 14.6569 13.6569 16 12 16Z"/>
        </svg>
      </span>
    </div>
  );
};

export default Topbar;
